  input: TEXT,F3XA,,"RFAI Response - Administrative Expenses -The Committee properly
    disclosed payments for administrative expenses.  The Committee does not have an
    office, it uses a post-office box for receiving mail.  The Committee's reports
    disclose payments to an accountant who processes contributions, deposits funds,
    pays expenses, prepares FEC reports, and handles other day-to-day items for the
    Committee.  The Committee hires fundraising consultants to help raise funds.  The
    Committee also pays a law firm to review legal matters that arise from time to
    time.  In addition, some individuals volunteer their personal time to assist the
    Committee.   The Committee did not receive any in-kind contributions in the form
    of goods or services (other than volunteer activity) during the Report period.  Therefore,
    none were reported.   Note that a non-federal account was first opened in October,
    2001, and the report covering that period included the Schedule H1."
